import React from "react";

const NewBlog = ({ blog }) => {
  console.log(blog);
  const { name, details } = blog;
  return (
    <div>
          <h2>Name:{name}</h2>
          <p>{ details}</p>
    </div>
  );
};

export default NewBlog;
